export default class Filter extends Component {
    render() {
        return (<div className="filter" style={{ marginTop: "10%" }}><h4 className="filter_heading">Filters</h4><hr /><div>Uses</div><hr /><div>Company</div><hr /><div>Salt</div><hr /><div>Cost</div><hr /></div>)
    }
}
